// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Fixidity.sol";

interface IStaking {
    function stake( uint _amount, address _recipient ) external returns ( bool );

    function unstake( uint _amount, address _recipient ) external returns ( bool );

    function index() external view returns ( uint );
}

contract wBOSS is ERC20 {


    address public immutable staking;
    IERC20 public  BOSS;
    IERC20 public sBOSS;

    constructor( address _staking, IERC20 _BOSS, IERC20 _sBOSS ) ERC20( 'Wrapped sBOSS', 'wsBOSS' ) {
        require( _staking != address(0) );
        staking = _staking;
        require( address(_BOSS) != address(0) );
        BOSS = _BOSS;
        require( address(_sBOSS) != address(0) );
        sBOSS = _sBOSS;
    }

        /**
        @notice stakes BOSS and wraps sBOSS
        @param _amount uint
        @return uint
     */
    function wrapFromBOSS( uint _amount ) external returns ( uint ) {
        BOSS.transferFrom( msg.sender, address(this), _amount );

        BOSS.approve( staking, _amount ); // stake BOSS for sBOSS
        IStaking( staking ).stake( _amount, address(this) );

        uint value = wBOSSValue( _amount );
        _mint( msg.sender, value );
        return value;
    }

    /**
        @notice unwrap sBOSS and unstake BOSS
        @param _amount uint
        @return uint
     */
    function unwrapToBOSS( uint _amount ) external returns ( uint ) {
        _burn( msg.sender, _amount );

        uint value = sBOSSValue( _amount );
        sBOSS.approve( staking, value ); // unstake sBOSS for BOSS
        IStaking( staking ).unstake( value, address(this) );

        BOSS.transfer( msg.sender, value );
        return value;
    }

    /**
        @notice wrap sBOSS
        @param _amount uint
        @return uint
     */
    function wrapFromsBOSS( uint _amount ) external returns ( uint ) {
        sBOSS.transferFrom( msg.sender, address(this), _amount );

        uint value = wBOSSValue( _amount );
        _mint( msg.sender, value );
        return value;
    }

    /**
        @notice unwrap sBOSS
        @param _amount uint
        @return uint
     */
    function unwrapTosBOSS( uint _amount ) external returns ( uint ) {
        _burn( msg.sender, _amount );

        uint value = sBOSSValue( _amount );
        sBOSS.transfer( msg.sender, value );
        return value;
    }

    /**
        @notice converts wBOSS amount to sBOSS
        @param _amount uint
        @return uint
     */
    function sBOSSValue( uint _amount ) public view returns ( uint ) {
        return Fixidity.fromFixed(Fixidity.divide(
            Fixidity.mul( 
                Fixidity.newFixed(IStaking( staking ).index()), Fixidity.newFixed(_amount)), 
                Fixidity.newFixed(10 ** decimals())));
    }

    /**
        @notice converts sBOSS amount to wBOSS
        @param _amount uint
        @return uint
     */
    function wBOSSValue( uint _amount ) public view returns ( uint ) {
        return Fixidity.fromFixed(Fixidity.divide(
            Fixidity.mul( 
                Fixidity.newFixed(_amount), Fixidity.newFixed(10 ** decimals())), 
                Fixidity.newFixed(IStaking( staking ).index())));
    }

}

